import * as React from 'react';

export type LogoFlyingSColor = "red" | "white" | "black";

export type LogoFlyingSSize = 18 | 24 | 30 | 36 | 42 | 48 | 72;

export interface LogoFlyingSProps {
    /**
     * Color of logo
     */
    color?: LogoFlyingSColor;
    /**
     * Size of logo
     */
    size?: LogoFlyingSSize;
    /**
     * Unique id for the logo, required for accessibility / screenreaders
     */
    id: string;
    /**
     * Description that is read by screenreaders
     */
    logoDescription?: string;
}

declare const LogoFlyingS: React.FC<LogoFlyingSProps>;

export default LogoFlyingS;

